import { All_Stories, Button } from "../comps/Portal";

const Stories = () => {
  return (
    <div className="pagecenter-x pb-40">
      <h1 className="title">Customer Stories</h1>
      <All_Stories />
      <section className="bg-slate-100 w-full min-h-[45vh] text-center">
        <h2 className="title">Submit your story, photo, or video</h2>
        <a href="mailto:duckduckstay@hotmail.com" className=""></a>
      </section>
    </div>
  );
};

export default Stories;
